  }
});
router.beforeEach(function (to, from, next) {
  //CHECKS IF THE TO ROUTE REQUIRES AUTHENTICATION
  if (to.matched.some(function (record) {
    return record.meta.requiresAuth;
  })) {
    //If there is a token stored on local storage
    if (localStorage.getItem('token') == null) {
      next({
        path: '/login',
        params: {
          nextUrl: to.fullPath
        }
      });
    } else {
      // get the role from local storage if token is not null
      var userRole = JSON.parse(localStorage.getItem('userRole')); //check if route path requires superAdmin

      if (to.matched.some(function (record) {
        return record.meta.is_superAdmin;
      })) {
        //Check if the role is not superAdmin User
        if (!(userRole == 0)) {
          next({
            path: '*'
          });
        } //if the userRole is Church or somethine else
        else next({
            path: '/'
          });
      } else {
        next();
      }
    }
  } // Does not requires Authentication
  else {
      next();
    }
});
export default router;

